import React from 'react'
import {Line} from 'react-chartjs-2';
import myData from '../cdata.json';

import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
  } from 'chart.js';
  
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);



const data = {
    labels: [
        1990,1991,1992,1993,1994,1995,1996,1997,1998,1999,
        2000,2001,2002,2003,2004,2005,2006,2007,2008,2009,
        2010,2011,2012,2013,2014,2015,2016,2017,2018,2019,
        2020,2021,
    ],
    datasets: [
      //RUG
        {
          label: 'RUG',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.RUG;
          })
        },
      //UvA
        {
          label: 'UVA',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: myData.map((item)=>{
            return item.RUG;
          })
        },
      //RU
        {
          label: 'RU',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //VU
        {
          label: 'VU',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //TUD
        {
          label: 'TUD',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //TUE
        {
          label: 'TUE',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //WUR
        {
          label: 'WUR',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //EUR
        {
          label: 'EUR',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //UU
        {
          label: 'UU',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //LU
        {
          label: 'LU',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //UM
        {
          label: 'UM',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //UT
        {
          label: 'UT',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
      //UvT
        {
          label: 'UvT',
          fill: false,
          lineTension: 0.5,
          backgroundColor: 'rgba(75,192,192,1)',
          borderColor: 'rgba(0,0,0,1)',
          borderWidth: 2,
          data: [100,400,500,300,100,0,500,200]
        },
        
      ]
};


const config = {
    type: 'line',
    data: data,
    options: {
      responsive: true,
      plugins: {
        tooltip: {
          mode: 'index',
          intersect: false
        },
        title: {
          display: true,
          text: 'Chart.js Line Chart'
        }
      },
      hover: {
        mode: 'index',
        intersec: false
      },
      scales: {
        x: {
          title: {
            display: true,
            text: 'year'
          }
        },
        y: {
          title: {
            display: true,
            text: 'count'
          },
          min: 0,
          ticks: {
            stepSize: 100
          }
        }
      }
    },
  };



function ThesesChart() {
    return (
       <Line 
       data = {data} 
       options={config}
       />
    );
}

export default ThesesChart
